import './home.scss';
import p from '../../img/car.jpg';


const OneAuction = (props) => {
  return (<>

     <br />
    <h1>המכירה של</h1>
    <p>{props.item.name}</p>
    <br />
  </>
  )
}
export default OneAuction;
